import React, { useState, useEffect } from 'react';
import Facade from './ApiFacade'

import Accountinfo1 from '../components/Accountinfo1';
import Accountinfo2 from '../components/Accountinfo2';

export default function LoggedIn(props) {
  const [username, setUsername] = useState();
  const [balance, setBalance] = useState();

  useEffect(() => {
    Facade.fetchUser().then(res => { setUsername(res.userName); setBalance(res.balance); }).catch(e => console.log(e));
  }, [])

  const logout = () => {
    Facade.logout();
    setLoggedIn(false);
  }

  return (
    <div class="row">
      <div class="col-6 col-md-2 logged-in-left-menu logged-in-col">
        <div className="row left-menu-row"><div className="col align-self-center"><Accountinfo1 username={username} /></div></div>
        <div className="row left-menu-row"><div className="col align-self-center"><Accountinfo2 balance={balance} /></div></div>
        <div className="row left-menu-row"><input type="submit" class="fadeIn fourth" value="Log Out"></input></div>

      </div>

      <div class="col-12 col-sm-6 col-md-8 logged-in-right-menu logged-in-col">.col-12 .col-sm-6 .col-md-8</div>

    </div>
  )
}
